SET SQL_MODE="NO_AUTO_VALUE_ON_ZERO";
SET time_zone = "+00:00";

CREATE TABLE IF NOT EXISTS `k_banner` (
  `idbanner` int(4) NOT NULL AUTO_INCREMENT,
  `online` enum('s','n') NOT NULL DEFAULT 's',
  `title` varchar(255) NOT NULL,
  `description` text NOT NULL,
  `url` varchar(250) DEFAULT NULL,
  `categoria` int(8) NOT NULL,
  `views` int(8) NOT NULL,
  `offset` int(8) NOT NULL,
  `clicks` int(8) NOT NULL,
  `ordine` int(2) NOT NULL,
  `ll` varchar(2) NOT NULL,
  PRIMARY KEY (`idbanner`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ;


CREATE TABLE IF NOT EXISTS `k_categorie` (
  `idcat` int(3) NOT NULL AUTO_INCREMENT,
  `tabella` varchar(250) DEFAULT NULL,
  `ref` int(3) NOT NULL DEFAULT '0',
  `categoria` varchar(250) DEFAULT NULL,
  `dir` varchar(64) NOT NULL,
  `ordine` int(3) NOT NULL,
  `ll` varchar(2) DEFAULT NULL,
  PRIMARY KEY (`idcat`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 ;




CREATE TABLE IF NOT EXISTS `k_commenti` (
  `idcomm` int(8) NOT NULL AUTO_INCREMENT,
  `ip` varchar(15) DEFAULT NULL,
  `data` datetime NOT NULL,
  `tabella` varchar(64) DEFAULT NULL,
  `id` int(8) NOT NULL,
  `autore` varchar(255) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `testo` text,
  `public` enum('s','n') NOT NULL DEFAULT 'n',
  PRIMARY KEY (`idcomm`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ;


CREATE TABLE IF NOT EXISTS `k_config` (
  `idconf` int(3) NOT NULL AUTO_INCREMENT,
